import React from "react";

export default function Lol() {
  return (
    <div
      style={{
        width: "98.6%",
        alignItems: "center",
        justifyContent: "center",
        display: "flex",
        flexDirection: "column",
        position: "relative",
      }}
    >
      <h1>Certificate</h1>
      <MvHeaderCerti headerTitle="Tuan 1 hhghgghhghhg"/>
      <MvHeaderCerti headerTitle="Tuan 2 hhghgghhghhg"/>
      <MvHeaderCerti headerTitle="Tuan 3 hhghgghhghhg"/>
      <MvHeaderCerti headerTitle="Tuan 4 hhghgghhghhg"/>
    </div>
  );
}
export function MvHeaderCerti({headerTitle}) {
  return (
    <>
      <div style={{ width: "100vw", height: " 30vh", background: "aqua" , marginTop:"30px"}}>
        {headerTitle}
      </div>
    </>
  );
}
